/** @format */

import React from 'react';
import '../App.css';
import { SupplierList } from '../TextInfo';
import SupBlock from '../components/SupBlock';
import Swipe from '../components/Swipe';

const Suppliers = () => {
	return (
		<div className='container_page'>
			<div className='filler-text'>
				<h1 className='title_exp'>Doing the right thing is important for our future generations –</h1>
				<p>Under that perspective from chef Yannick’s integrity of food and resources, introducing commercial players within the supply chain is key to reduce our carbon foot print, the over-fishery, utilization of plastics in the food and catering industry.</p>
			</div>
			<h3 className='title_exp'>Past events supporting suppliers with</h3>
			<div className='container_exp'>
				<span className='exp_li supplier'>
					{SupplierList.map( ( item, index ) => {
						return (
							<span key={index}>
								<SupBlock i={index} />
							</span>
						);
					} )}
				</span>
			</div>
			<div style={{ display: "flex", justifyContent: "center", marginBottom: "5vh" }}>
				<Swipe for="sustain" path="sustainPhotos" />
			</div>
		</div>
	);
};

export default Suppliers;
